window.bookSummaryJSON = "<p><b>I tried to remember. I wanted to remember.</b></p> <p>Moving on from an unknown past was all that was left for me to do. So, I went home. I went back to my safe, boring life. Just a girl and her dog.</p> <p>Well, that was until an angry HellBeast King turned up and found me. A furious, sexy, hotblooded male from my past who now wants to convince me... He is my future. He is my everything. The problem is, he still terrifies me.</p> <p>What I soon realize is he isn't the only scary thing out there in my woods. He also isn't the only one who wants me.</p> <p>Just how far will he go to claim me once more? And what would he be willing to do to keep me? What would make him believe the only way to hold onto my heart was by committing <i>A HellBeast's Sacrifice?</i></p>"; 
